import React from "react";

class ToneButton extends React.Component {
  constructor(props) {
    super(props);
    this.state = { color: "#ababab" };
  }
  render() {
    return (
      <button
        style={{
          color: this.state.color
        }}
      >
        test
      </button>
    );
  }
}

export default class LibraryContainer extends React.Component {
  render() {
    return (
      <div>
        {" "}
        <ToneButton />
      </div>
    );
  }
}
